import { useEffect, useState } from "react";

export default function Result({city}){
  const [countries, setCountries] = useState();

  useEffect(() => {
    let countries = [];
    city.map((ville) => {
        const arr = ville.name.split(',');
        const country = arr[arr.length -1];
        if (countries.length > 0 && countries.includes(country) === false){
          countries.push(country);
        }
    })

    setCountries(countries.map((country) => {
      return <div className="flex space-x-4" key={country}>
              <h2>{country}</h2>
            </div>
    }))  
    console.log('countries = ', countries)
  }, [city])

    if(city[0]) {
    return (
        <>
        <div className="flex flex-col items-center justify-center">
          <div>Countries where there is at leat one city called {city[0].short} :</div>
          <div className="flex space-x-8 items-center justify-center">
            {countries}
          </div>
      </div>
        </>
    )
}
}
